import React from "react";
import "./nav-bar.css";
import { Link } from "react-router-dom";

function NavBar() {
  return (
    <nav>
      <p className="logo">
        <a href="/">
          onur<span>yildirim</span>
        </a>
      </p>
      <ul className="links">
        <li className="link">
        <Link to="/">Home</Link>
        </li>
        <li className="link">
          <a href="/">Blog</a>
        </li>
        <li className="link">
          <a href="/">Contact</a>
        </li>
        <li className="link">
          <Link to="/about">About</Link>
        </li>
      </ul>
    </nav>
  );
}

export default NavBar;
